import React from "react";
import "../styles/Header.css";

// By importing the Header.css file, it is added to the DOM whenever this component loads
const styles = {
  heading: {
    background: "red",
    fontSize: "100px"
  }
};
function Header() {
  return (
    <header style={styles.heading} className="header">
      <h1>Welcome</h1>
    </header>
  );
}

export default Header;
